import React from 'react';
import logo from './logo.svg';
import './App.css';
import Header from './tutorial/header'
import NavBar from './tutorial/navbar'
import Footer from './tutorial/footer'


function App() {
  return (
    <div className="App">
      <Header />
      <NavBar />
      <Footer />

    </div>
  );
}

export default App;
